import "./App.css";
import React, { useState } from "react";

function App() {
  let title = "Okurmen";
  const [timer, setTimer] = useState(0);

  function handleTimer() {
    setTimer(timer + 1);
  }

  return (
    <div className="App">
      <div className="Container">{title}</div>
      <h2>{timer}</h2>
      <button onClick={handleTimer}>Increment Function</button>
      <button onClick={handleTimer}>Decrement Function</button>
    </div>
  );
}

export default App;
